import React from 'react'
import styled from 'styled-components'

const StyledMessage = styled.button`
    width: 200px;
    border-style: none;
    border-radius: 25px;
    background-color: green;
    text-align: left;
    display: block;
    margin-top: 5px;
    margin-bottom: 5px;

    padding-left: 10px;
    padding-top: 10px;
    padding-bottom: 10px;

    overflow-y: auto;
    white-space: nowrap;
    display: block;
    text-overflow: ellipsis;
`

function Message(props) {
    return (
        <StyledMessage>
            {props.test}
        </StyledMessage>
    )
}

export default Message
